import React from "react";

export default function ImgInput({title,id,frontPH,src}) {
  return (
    <div className=" mb-3">
      <p className=" font-bold text-xs">{title}</p>
      <span className=" my-1 block  w-52 h-full border bg-white">
        <input type="text" className="w-28 h-3 text-xs p-2" id={id} placeholder={frontPH} />
        
      </span>
      <img src={src}></img>
    </div>
  );
}
